  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The Centers for Medicare (CM) has created
  a set of standard analytical files that contain Shared Savings Program Accountable
  Care Organizations. Beneficiary-level research identifiable file (RIF) that will
  contain a record for every beneficiary that participated in the Shared Savings Program.<br
  />nThe data file is structured in a way that allows CMS to respond to a wide range
  of potential inquiries. For example, analysts should be able to use the data to
  examine differences in beneficiary characteristics between ACO and non-ACO beneficiaries,
  stability of beneficiary alignment during and across performance years and the extent
  to which aligned beneficiaries receive care outside of the ACO, differences in beneficiary
  characteristics between ACO aligned beneficiaries who were and were not used for
  financial reconciliation.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
